import React from 'react';

const Header = () => {
  return (
    <header className="app-header">
      <div className="toolbar">
        <button>Opção 1</button>
        <button>Opção 2</button>
        <button>Opção 3</button>
      </div>
    </header>
  );
};

export default Header;
